{"1": ["не удобная и очень низкая", "2017-07-10T18:29:14+03:00", "черный", "0", 1, 0, 3, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "2": ["08.07.17 купила этот органайзер в багажник. Материал тонкий,прошит плохо... пропуски на швах или их отсутствие / на липучке/Прошивала сама.Нагружать сильно и при этом вытаскивать из багажника даже не думаю - развалится. Так что купите себе что то получше,чем эта вещь .", "2017-07-08T23:23:30+03:00", "черный", "0", 5, 0, 2, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "3": ["Заказал эту сумку в автомобильный багажник, чтобы всякую мелочь (шампунь, полировки, тряпочки...) не летали по багажнику. Сумка сделана из очень тонкого и отвратительного материала, липучки на крышке пришиты как попало. Через два дня доставал из багажника эту сумку и у нее отвалилось дно. Перегородка совсем не держится. Не тратьте зря деньги.", "2017-07-02T20:05:40+03:00", "черный", "0", 6, 0, 1, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "4": ["Да, тоненький, держится все на липучках, антискользителя никакого нет. Оставили, за триста с небольшим рублей большего ждать не нужно. На крышке даже липучки неровно пришиты, не совпадают с липучками на корпусе. Хотя якобы сделано в России, такое только Китаю простительно.", "2016-12-18T23:14:54+03:00", "черный", "0", 3, 0, 4, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "6": ["Один минус-тонковат.Днище слабовато. Пошив качественный.Смотрится неплохо", "2016-10-01T19:46:20+03:00", "черный", "0", 0, 1, 3, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "7": ["Органайзер оставляет желать лучшего, днище тонкое, не снабжено жесткой прокладкой, где антискользители так и не поняли,со скидкой 293 руб., думаю даже таких денег не стоит.", "2016-09-09T15:16:45+03:00", "черный", "0", 7, 0, 2, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "8": ["Хлипкий, и неудобный в сборке.", "2016-08-27T15:46:26+03:00", "черный", "0", 3, 1, 2, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "9": ["Хлипкий. Это не сумка - это конструктор (( Отказ.", "2016-07-31T16:35:35+03:00", "черный", "0", 1, 0, 3, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "10": ["Сумка хлипкая и маленькая. Цена соответствует.", "2016-07-29T08:36:02+03:00", "черный", "0", 1, 0, 3, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "11": ["у меня маленький багажник, и эта вещь нормально вошла туда, в одно отделение я уложила аптечку, шампунь, тряпочки, компрессор, а в другом у меня сложенное покрывало для пляжа, купальники, нормальный кейс, хлипкий конечно, но что вы хотели за такую цену, я брала с тем что я его могу сложить в любое время как картонку и место занимать не будет, а другие плотные как чемоданы надо выкладывать куда то", "2016-07-13T18:49:10+03:00", "черный", "0", 1, 0, 4, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "13": ["Цена = качество. меня устроил кейсик, много с собой не вожу, а там все мелочи хорошо лежат", "2016-07-01T14:41:46+03:00", "черный", "0", 1, 0, 5, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "14": ["Хлипкий очень. И самое главное - он конструктор \"лего\". Отказ, взял другую модель более надежную.", "2016-06-21T15:41:04+03:00", "черный", "0", 1, 0, 3, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "15": ["Органайзер не соответствует описанию, без крышки, маленький.", "2016-06-11T03:12:45+03:00", "черный", "0", 5, 0, 1, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "16": ["Ужас. У меня кейс в машине как на этой картинке. Повелась заказала. Хотя понимала мой 1500 а тут 350. Картонка хлипкая не серьёзная, маленькая. Ни о чем.", "2016-05-22T14:38:34+03:00", "черный", "0", 3, 0, 2, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "17": ["Липучки вообще не функционируют. Ткань очень тонкая, точно не для вещей в багажнике.", "2016-05-21T12:22:32+03:00", "черный", "0", 4, 0, 1, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "18": ["Обычный органайзер, углы крепятся на липучках, держатся хорошо, не разваливаются. Полезная вещь для барахла в багажнике", "2015-12-27T07:48:56+03:00", "черный", "0", 6, 0, 5, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "19": ["Пользуюсь этим органайзером с декабря 2015 года. Он собирается, и крепится на липучках, так вот, эти липучки за время использования оторвались (но пришить можно), не скажу что я часто открываю багажник и постоянно что-то кладу в органайзер, но за полгода довольно редкого использования он развалился, цена = качеству, брать или нет решать вам", "2016-05-15T13:06:29+03:00", "черный", "0", 6, 0, 2, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "20": ["В моём понимании, такая вещь должна быть очень надёжной, т.к. в багажнике чего только не бывает. Но данный органайзер уж такой тщедушный, что только пылинки с него сдувать, чтоб не порвался-сломался. конструкция крайне ненадёжная, отказ.", "2016-01-25T13:31:57+03:00", "черный", "0", 7, 0, 1, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "21": ["Весьма ненадёжная конструкция, если его действительно забить всякими автомобильными штуками, то он, скорее всего, просто развалится. Даже просто держать его в руках было неприятно, такого характера вещь должна быть очень надёжной. Естественно, отказались и купили у другого производителя.", "2016-04-24T21:11:05+03:00", "черный", "0", 3, 0, 1, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "22": ["Сумка для мелочей из багажника. Материал не паращютная ткань,  но вполне плотный. Все на липах, складывается ровно по форме. Качественно пошито.", "2016-03-09T12:01:54+03:00", "черный", "0", 8, 0, 5, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "23": ["Нам тоже подошол, и сверху удобно,что закрыто", "2016-02-29T06:58:46+03:00", "черный", "0", 3, 0, 5, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "24": ["Нам органайзер подошел. Все липучки на месте, легко собирается. Дно и крышка тонкие, но мы его таскать и не собираемся. Поставили в багажнике, собрали в него всю мелочевку, и пусть себе стоит. Очень удобно. Правда крупные вещи (н-р, щетка с длинной ручкой) в него не влезут. Зато мелочь всякая по багажнику не катается.", "2016-02-22T11:17:33+03:00", "черный", "0", 3, 0, 4, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "25": ["Данный органайзер по качеству и материалу на 3-ку, материал тонкий. Сам органайзер как пазл, надо собрать,крепится на липучки. Что мне показалось не очень удобным и надежным. Дно органайзера тонюсенькое, да и скользит. Примеряли конкретно в багажнике. Поэтому отказ в пользу другого органайзера.", "2016-02-07T13:36:58+03:00", "черный", "0", 5, 0, 2, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "26": ["Отличная штука. Теперь у меня в багажнике порядок. Да тонкое дно, но я же не собираюсь им елозить по багажнику или еще по чем нибудь и тяжести в нем не собираюсь переносить:-)  А для того что бы всякая нужная ерунда была под рукой и на месте органайзер подходит.", "2016-01-28T14:54:28+03:00", "черный", "0", 6, 0, 5, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "27": ["Взяли на подарок, оказалось, не хватает липучек, чтобы зафиксировать углы(", "2015-12-29T12:47:11+03:00", "черный", "0", 2, 0, 3, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "28": ["Мне не понравилась сумка,пыталась собрать углы на липучки, они вообще не держатся.Всё рассыпится.", "2015-12-26T13:35:25+03:00", "черный", "0", 1, 0, 2, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "29": ["ужасно", "2015-12-19T23:26:33+03:00", "черный", "0", 2, 5, 1, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "30": ["Наконец то нашла время написать отзыв. Хотела взять но оказалась с браком, перекладина по середине не правильно была пришита. Бралось в подарок, пришлось искать что-то другое.\r\nОчень расстроилась.\r\nпочему то этот брак не учли при расчете моей скидки", "2015-12-18T15:14:41+03:00", "черный", "0", 2, 0, 2, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "31": ["Ткань типа плащевки.Он разбирается,удобно постирать.Удобный,вместительный.Мы довольны.", "2015-12-10T20:47:51+03:00", "черный", "0", 6, 0, 5, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "32": ["Сложила, поставила, теперь в багажнике порядок. Красота", "2015-12-07T11:07:14+03:00", "черный", "0", 3, 0, 5, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "33": ["Брака не было,заказывали 2 шт,посмотрим как будут в использовании", "2015-12-07T01:44:30+03:00", "черный", "0", 1, 1, 5, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "34": ["Материал а дне и крышке тоненький, аж просвечивается.", "2015-11-24T18:59:51+03:00", "черный", "0", 3, 0, 3, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"], "35": ["Отличный органайзер. Качественный. Муж очень доволен!", "2015-10-05T21:34:50+03:00", "черный", "0", 7, 1, 5, "Сумка в багажник \"органайзер закрытый\"", "АНТЕЙКО"]}
